INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(5, 'Apple', 'MacBook Air', 'The MacBook Air is still the world''s thinnest laptop and is ultraportable and very impressive with the features that are on board.  The MacBook Air is as thin as your index finger, yet it comes with an 13.3 inch LED backlit display and a full sized keyboard as well as a Multi-Touch trackpad. Nothing is as portable as the MacBook Air and the unibody design is formed from a single piece of aluminum which makes it incredibly durable. It weighs in at just 3 pounds and is more then ready to go everywhere with you.  The MacBook Air''s performance is just as powerful as its looks with its 1.6GHz or 1.86GHz Intel Core 2 Duo processor. The new 1066MHz frontside bus and additional L2c cache and 2GB of DDR3 RAM gives you more than enough speed and memory for all you do.  Movie and video playback is rich and memorable on the MacBook Air. The NVIDIA GeForce 9400M brings amazing, high speed graphics to life and intensive graphic applications run faster on the Air.  The MacBook Air takes 100% advantage of the wireless world. Instead of watching DVDs, with the MacBook Air you can rent movies wirelessly from the iTunes Store and instead of backing up files to discs you can simply back up your files wirelessly using Time Capsule. For when you need to install software from a CD or a DVD, just use the Remote Disc feature so that you can wirelessly "borrow" the optical drive of a MAC or a PC.', 1624.00, '1.6 GHz', '2 Gb', '500 Gb', '13.3"', , 0, 'Laptop'),
(1, 'Dell', 'XPS M1530', 'Design, performance and astonishing functionality are yours with the Dell XPS M1530 laptop.  Powered by an Intel Core 2 Duo T6400 processor, a 4GB Shared Dual Channel DDR2 SDRAM and the 320GB, 5400rpm SATA Hard Drive, you have all the space, speed and performance you''d expect from a high-end laptop.  With Microsoft''s latest operating System-Ultimate Windows Vista Productivity, you will have complete control over the network controls, search features and the built-in Media Center to manage your videos and digital photos.  Express yourself by choosing the XPS M1530 in one of four premium colors: Tuxedo Black, Product Red, Midnight Blue or Flamingo Pink. With the integrated Dell MediaDirect, you''re given instant and one touch access to music, movies and photos without even having to boot up the laptop. These low profile and touch sensitive media buttons above the keyboard will take you straight to where you want to be.  The XPS M1530 features a smart and innovative fingerprint scanner for added security, so no more worries about forgetting your password.  The Hi-definition display on the XPS M1530 boasts 800 lines of resolution for superb viewing. The HDMI output lets you easily connect to an Hi Definition display for gorgeous and sharp image and sound transfer.', 1189.00, '3.6 GHz', '4 Gb', '320 Gb', '16.5"', , 79, 'Laptop'),
(2, 'HP', 'Mini 2140', 'The HP Mini 2140 laptop caters to the mobile professional as it sports a durable chassis, a very well-designed keyboard and offers a big 10 inch screen. The Mini 2140 features an brushed silver, all aluminum lid and a solid magnesium alloy chassis. The hinges are also metal as well as the hardened steel pin axles. This build can endure having the lid closed and opened ten times a day for six years.  The HP Mini 2140 is compact as it measures 10.3'''' x 6.5'''' x 1.1''''. It weighs 3 pounds with the six cell battery that gives you an impressive 7+ hours of runtime.  The keyboard is 92% the size of a standard laptop keyboard and is resistant to wear. It is treated with a special coating to make it endure prolonged use. The touchpad is comfortable and easy to use.  The HP Mini 2140 has two USB ports, an SD card reader, headphone and microphone jacks, a VGA port and an Ethernet jack. You are also offered an ExpressCard/54 slot that is perfect for adding a mobile broadband card to the system.  The 10.1 inch 16:9 glossy display with its native resolution of 1024 x 576, is bright and boasts a scratch-resistant surface.  Embedded into the bezel above the display is a 0.3 megapixel camera and dual stereo microphones. Your Skype call quality will be very solid and you will be seen clearly by the person with whom you are videoconferencing with. The integrated speakers that are hidden below the screen are loud and clear.  The efficient 1.6 GHz Atom N270 processor together with the 1GB of RAM provides the HP Mini 2140 with quick and impressive performance.  The HP Mini 2140 rises above the crowd in the small laptop world by incorporating the well designed keyboard, the durable design and more then 7 hours of battery life.', 399.00, '1.6 GHz', '1 Gb', '80 Gb', '10.0"', , 214, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(3, 'Asus', 'K40IJ-A1', 'Are you looking for a no frills computing experience while on the go? If you answered yes to that question, then you should grab an Asus K40IJ-A1! That''s an order. This laptop boasts the muscles to provide the cinematic sound and visual enjoyment that you''d find in a home theater. With the Asus K40IJ-A1, you can now experience immersive entertainment no matter where you are...in comfort and in style.  The Asus K40IJ-A1 showcases a 14 inch high definition LED backlit display as well as a 16:9 golden aspect ratio that works well to provide high contrast rate as well as color saturation. Like the previous notebooks from Asus, this one is very well complimented with Altec Lansing Speakers beefed up with SRS Premium Sound Technology as well as virtual surround sound...offering high definition audio enjoyment.  - It comes with an Intel Core 2 Duo T6400 Processor at a speed of 2.0 GHz. With a Core 2 Duo processor, your Asus K40IJ-A1 can keep up with multiple tasks from different applications, programs, and more.  - With 4 GB of RAM coupled with other handy features, your Asus K40IJ-A1 can keep up even with the most demanding games, programs, applications, etc. Not to mention you can upgrade it by getting more memory modules of the same speed and capacity.  - With the 250 GB SATA hard drive at 5400 RPM, you can store anything! Videos, sounds, games, images, etc. - your Asus K40IJ-A1 will have more than enough space for anything you want to keep. Combine that with a 14 inch high definition screen, you are bound to enjoy multimedia experience like you never did before.', 652.00, '2.0 GHz', '4 Gb', '250 GB', '14.0"', , 31, 'Laptop'),
(11, 'Apple', 'iPad 2', 'When you pick up iPad, it becomes an extension of you. That’s the idea behind its innovative design. It’s just 0.34 inch thin and weighs as little as 1.33 pounds, so it feels completely comfortable in your hands.2 And it makes surfing the web, checking email, watching movies, and reading books so natural, you’ll wonder why you ever did it any other way. Pick up your iPad, press the Home button, and it wakes from sleep instantly. That’s because iPad features fast, efficient, and reliable flash storage that lets you access data quickly. So everything effortlessly springs to life. Two powerful cores in one A5 chip mean iPad can do twice the work at once. Multitasking is smooth, apps load quickly, and anything you touch responds instantly. And with up to nine times the graphics performance of the first-generation iPad, everything on iPad 2 is even more fluid and realistic, from gameplay to scrolling through your photo library. Even with such a thin, light design, iPad has an incredible 10-hour battery life.1 That’s enough juice for one flight across the ocean, or one movie-watching all-nighter, or a week’s commute across town. Because iPad hardware and software are made for each other, the power-efficient A5 chip works with the iOS software to keep battery life from fading away.', 400.00, '1 Ghz', '1 GB', '64 GB', '10"', , 100, 'Tablet'),
(4, 'Dell', 'Inspiron Mini 12', 'Mini laptops have been defined by their small 7 to 10 inch displays until the emergence of the Dell Inspiron Mini 12. It is the first mini laptop to offer an 12 inch display. The whole laptop is less than an inch thick, giving this Dell the profile of an ultra-portable netbook.  The 1.6 GHz Intel Atom processor and 1GB of RAM makes this small netbook a performer. You will get more than five hours of battery life with its six cell battery.  The rounded lid has a glossy black or white coating and under the lid the black keyboard is set off by the smooth, silver palm rest and screen bezel. The most striking feature of the Dell Inspiron Mini 12 is its thin stature. The laptop is 11.8 x 9 x .9 inches and weighs in at just 3.2 pounds with the battery. It''s super easy to slide into a shoulder bag.  An outstanding feature of the Inspiron Mini 12 is the keyboard. The full size layout is great for touch typists and it contains a row of Function keys. The keyboard provides great feedback and is void of any flex.  The touchpad is large and spacious and has a textured surface.  You are offered three USB ports, a VGA, Ethernet jack an headphone/mic jacks. A 3-in-1 card reader is on the right side.  The 1280 x 800 pixel resolution 12 inch screen makes a world of difference compared to the 10 inch screens. You can keep two web pages open side by side and read them without a problem. The screen has very minimal glare and is a pleasure to view.  Just above the display is the 1.3 megapixel webcam that works great with Dell''s Video Chat powered by Sightspeed. Your callers will always see you clearly.  The Dell Inspiron Mini 12 has re-set the bar with its big 12 inch screen and this little laptop is an impressive performer.', 300.00, '1.6 GHz', '1 GB', '160 GB', '12.0"', , 24, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(6, 'Apple', 'MacBook 13 Inch', 'From one solid piece of aluminum comes the thin and highly stylish MacBook 13 Inch. It is refined and polished and it feels strong and very durable.  The MacBook 13 Inch features a wide 13.3 inch screen that has a glossy surface that livens up your photos and movies. The chassis is just one inch thick, so it is simple to slide it into a briefcase or backpack. The MacBook 13 Inch is made from the same polycarbonate plastic that bulletproof windshields are made from and the 13 Inch weighs 5.1 pounds.  Apple uses a Intel Core Duo T2500 2.0 GHz processor and integrated graphics in the MacBook 13 Inch. The ultrathin 13.3 inch LED backlit display is breathtaking and you see everything with amazing clarity and perfect brightness.  The keyboard on the MacBook 13 Inch is solid, very responsive and comfortable. An illuminated keyboard comes standard on the 2.4 GHz model, so when you''re in low-light areas, you can always see what you are typing.  The amazing trackpad on the MacBook 13 Inch doubles as a button. Just press down anywhere and that''s a click! Use two fingers to scroll up and down a page and pinch to zoom in and out. With a swipe of three fingers you can flip through your digital photo albums. With the four finger swipe gesture, you can swipe left or right to switch between applications. The more you use this trackpad, the more you''ll love it!', 1100.00, '2.0 GHz', '1 GB', '160 GB', '13.3"', , 40, 'Laptop'),
(7, 'HP', 'Pavilion G60-230US', 'Are you always pestered by black bars whenever you''re watching DVD films and movies in your laptop or PC? If you answered yes to that, then you will find the HP Pavilion G60-230US to be a breath of fresh air. It doesn''t matter what High Definition TV content and DVD movie you''re watching on the HP Pavilion G60-230US, the 16 inch LCD display along with the true 16:9 aspect ratio will give you the movie and HDTV entertainment you''ve always been looking for.  Just like anything in the G60 series of laptops, the HP Pavilion G60-230US has been defined by minimalist lines. It comes with a glossy and reflective top cover and the palm area''s surface comes with a striking and clean contrast with the rest of the HP Pavilion G60-230US. The looks of the HP Pavilion G60-230US is very streamlined and the keyboard and touchpad has been color-matched and enhanced.  Do you love chit chatting with friends and relatives through the internet? If so, then you''ll love chatting face to face, grab images and pictures, as well as play video clips through the webcam and digital microphone that comes along with the HP Pavilion G60-230US. If you want to play games and enhance your multimedia experience, you''ll be pleased to know that HP Pavilion G60-230US comes with an Intel GMA 4500M that has up to 1309 MB of graphics memory. You can enjoy whatever movie you want to watch, whatever music you want to listen to within seconds! The external DVD and music buttons that it comes along with has access to HP QuickPlay...bypassing the boot process.  Let''s check out some of the basic facts about the HP Pavilion G60-230US, which you will surely love...  - The Processor - The 2.0 GHz Intel Pentium T4200 Dual Core Processor that is contained within HP Pavilion G60-230US will surely deliver the computing capabilities and resources that you''re looking for in a notebook or laptop. Digital rendering, gaming, running a virus scanner, and other background tasks - you can run all of these and you can be confiden', 579.99, '2.0 GHz', '1 GB', '80 GB', '16.0"', , 31, 'Laptop'),
(8, 'Asus', 'Eee PC 701', 'The ASUS Eee PC 701 would make a great starter computer for kids or the older person and would also be a great lightweight budget PC for those needing a second computer.  Highlighting its easy usage, the PC 701 offers just six options: Internet, Work, Learn, Play, Settings and Favorites. You will love having a clutter-free desktop for daily use and will find navigation simple on this ASUS.  The 7 inch 800 x 480 pixel display is very easy on the eyes, with brightness and color levels great and viewing from angles easy.  You will get an SD Card slot, two USB ports and a VGA port on the right hand side. The other USB port, Ethernet and modem connections, headphone and microphone jacks are on the left side.  You can do practically everything with the ASUS Eee PC 701 that you can do with any Windows-powered laptop. Use the internet area to launch Firefox, Wikipedia or Skype and utilize the instant messaging program to stay in touch with friends and family.  The PC 701 would be a great addition to a family with many computer users.', 76.00, '512 MHz', '256 MB', '8 GB', '7.0"', , 15, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(10, 'Toshiba', 'Satellite C655-S5339', 'Built-in webcams and microphones let you chat face-to-face, collaborate with classmates, videoconference, and generally improve the way you interact with the world around you. Transfer files easily from your digital camera, camcorder, MP3 player or smart phone, sharing home movies and playlists with SD cards, Memory Sticks and more. The two cores on this processor let you do more at once. They''re also energy-smart, sipping battery power so you can go farther unplugged. Engineered with respect to our planet, 93% of Toshiba laptops, netbooks and Tablet PCs have met the ENERGY STAR 4.0 standard since it was established in 2007.  Last longer, use less power, and warm up quicker with the unique LED backlit display. ', 415.99, '2.4 GHz', '4 GB', '320 GB', '15.6"', , 47, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(9, 'Lenovo', 'B560-433028U', 'Andy Rendich. CEO of Qwikster for about a week. You didn’t ask for the media frenzy. You just woke up and came into the office one morning to find out your boss had gone insane. But instead of walking away, as a lesser man might do, you took one for the team. You put your name on that disaster-in-progress and told the world… well, nothing really, because you didn’t even have time to figure out a business plan. But you were gonna do it, pal. You were gonna bring the heat. It was your moment to shine.  And today, you’re just back to the old office, because Qwikster is no more.  Andy, it’s not your fault, okay? You’re like this refurbished Lenovo Intel Dual-Core Laptop with 15.6” LED Display. It’s got a sweet 2.13GHz processor, and 2GB of DDR3 memory, and a 320GB hard drive, plus Window 7 Home Premium, 802.11b/g/n Wi-Fi, and a 15.6” widescreen LED display. It’s ready to work, and work hard. But nobody gives it a chance, do they? Just like you, man. Just like you.  But don’t you worry, Andy Rendich. Now your name is out there. Maybe not as out there as a Reed Hastings email, but out there nonetheless. When you go to your next job interview (probably on Tuesday if you’re smart) people are going to say “Rendich? Aren’t you that guy who almost ran Qwikster?” And when you say yes, they’ll shake their head, and maybe even give you a big hug.  Because you’re every kid who was open but didn’t get the ball. You’re every musician who had the chops but couldn’t get airplay. You’re Brando in On The Waterfront, you’re Dave Mustaine, you’re Takeru Kobayashi being dragged away by the cops just before the Nathan’s Hot Dog Eating Contest. You were there and ready and wanted to go, but someone else took your moment before you could prove yourself.  That dream is gone now, Andy Rendich, but it’s not your fault. Don’t blame yourself. Don’t blame yourself.', 300.00, '2.13 GHz', '2 GB ', '320 GB ', '15.6"', , 36, 'Laptop'),
(13, 'Apple', 'MacBook Pro MC721LL/A ', 'Introducing the new 15.4-inch MacBook Pro. The state-of-the-art quad-core Intel i7 processor delivers up to 2x faster performance (over the previous generation of MacBook Pro). New Thunderbolt technology lets you connect high-performance peripherals and high-resolution displays to a single port, and transfer files at lightning speeds. And with the new built-in FaceTime HD camera, you can make astonishingly crisp HD video calls.  With the revolutionary Thunderbolt technology, you''ll be able to achieve bi-directional channels with transfer speeds to peripherals like external hard drives and servers up to an amazing 10 Gbps--while also connecting to a DisplayPort-compatible high-resolution display.  As with previous models, the MacBook Pro features a precision unibody enclosure crafted from a single block of aluminum, creating a thin and light mobile computing workhorse (less than 1 inch thin and just 5.6 pounds) that''s also highly durable. It includes a 15.4-inch, LED-backlit glass display as well as a glass trackpad that doesn''t include a button (for larger tracking area) that features Apple''s Multi-Touch technology. And it comes standard with automatic graphics switching that provides performance when you need it and energy efficiency when you don''t. You''ll also get up to 7 hours of battery life while on the go.  This version of the 15.4-inch MacBook Pro (model MC721LL/A) features a 2.0 GHz Core i7 "Sandy Bridge" quad-core processor, 500 GB hard drive, and 4 GB of installed RAM. Other features include ultra-fast Wireless-N Wi-Fi networking, Bluetooth connectivity, an SDXC card slot, two USB 2.0 ports, and a FireWire 800 port (see full specifications below). It also comes with the Mac OS X Lion operating system as well as the iLife software suite, which includes the latest versions of iPhoto, iMovie, and GarageBand.', 1300.00, '2.0 GHz quad', '4 GB', '500 GB', '15.4"', , 36, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(12, 'Apple', 'MacBook Pro MB133LL/A', 'Stylishly and intelligently designed for mobile professionals, Apple''s MacBook Pro now includes Apple''s Multi-Touch technology (which debuted with the MacBook Air), allowing you to pinch, swipe, or rotate to enlarge text, advance through photos, or adjust an image. And it gets a serious speed bump from Intel''s latest 2.4 GHz 45-nanometer Penryn series Core 2 Duo processor, which also helps to reduce power requirements and save on battery life. This model (MB133LL/A ) also has a mercury-free, power-efficient LED-backlit display measuring 15.4 inches and a state-of-the art NVIDIA GeForce 8600M GT video card with 256 MB of GDDR3 video RAM.  Meticulously designed and encased in sleek and sturdy aluminum, the MacBook Pro measures just 1 inch thin and weighs 5.4 pounds. Your hands have room to spread out on the full-size keyboard with crisp, responsive keys, and the MacBook Pro has a built-in ambient light sensor that adjusts the keyboard and display brightness so it’s easy to work in low-light settings. Other standard Apple "extras" includes a built-in iSight video camera and Apple''s magnetically connected MagSafe power adapter, which safely disconnects when under strain.  It''s pre-loaded with Apple''s Mac OS X 10.5 Leopard operating system, which enables easy backup of your most important data via Time Machine, a redesigned desktop that helps eliminate clutter. It also comes with the iLife ''08 suite of applications--including iPhoto, iMovie, Garageband, and iTunes--and the newest version of the fast-loading Safari web browser. Other hardware features include a 200 GB hard drive, 2 GB of installed RAM (which can be upgraded to 4 GB), an 8x combo Superdrive (for burning dual-layer DVDs as well as CDs), built-in Gigabit Ethernet for high-speed networking, Bluetooth 2.1+EDR (Enhanced Data Rate), FireWire 400 and 800 ports, DVI video output, and an ExpressCard/34 expansion card slot for expansion solutions such as 3G wireless networking. ', 1250.00, '2.4 GHz', '2 GB RAM', '200 GB', '15.4"', , 150, 'Laptop'),
(14, 'Asus', 'A53U-XE1', 'Featuring the latest AMD Dual-Core C-50 Accelerated Processor with AMD Radeon™ HD 4250 graphics, the A53U-XE1 easily handles multitasking and entertainment on its brilliant 15.6" LED-backlit HD+ display. HDMI ready, supersize your high-definition media to an HDTV for up to 1080p visuals and 8 channel surround sound support. The A53U-XE1 is also engineered with ASUS IceCool technology with hairline brushed aluminum to maintain a low temperature on the keyboard and palm rest area for comfortable computing even after the longest sessions. Encased with an aluminum chassis, travel free with scratch-resistant, and smudge-resistant protection for robust durability day-in and day-out.', 411.99, '1.0 GHz', '3GB', '320GB', '15.6"', , 300, 'Laptop'),
(15, 'Asus', 'UX21E-DH71', 'It looks like nothing you''ve ever seen. It feels like nothing you''ve ever felt. It''s breathtakingly beautiful. It''s ultra-thin – with a minimum thickness of only .12". It''s ultra-light – the brushed aluminum alloy body weighs only 2.43lbs. It''s ultra-fast – powerful 2nd Generation Intel® Core™ i7 processor, SATA 3.0 SSD and USB 3.0. It resumes active mode in just 2 seconds, and the SonicMaster Audio delivers astounding sound. Introduce yourself to the most incredible Ultrabook™, the ASUS ZENBOOK™ – it will be love at first sight. ', 1259.95, '1.8 GHz duel', '4GB', '128GB SSD', '11.6"', , 44, 'Laptop');
INSERT INTO `laptop_store` (`item_number`, `brand`, `name`, `description`, `price`, `processor`, `memory`, `hard_drive`, `screen_size`, `image`, `Quantity`, `weight`) VALUES
(16, 'Asus', 'G74SX-DH71', '17.3" (1920x1080) Full HD LED/i-7 2670QM Quad Core (2.2GHz)/12GB DDR3 RAM/Nvidia GTX 560M 3GB GDDR5/1.5TB 7200/Windows 7 Home Premium/BluRay DVDRW CDRW/802.11BGN/2.0M Pixel/Bluetooth 3.0/8 Cell battery/HDMI Port/1 USB 3.0 Port/3 USB 2.0 Ports/Laptop Bag and Mouse/2YR Global Warranty/1 YR Accidental Damage Protection/30-Day Zero Bright Dot/2-Way Free Shipping/24-7 Tech Support ', 1800.00, '2.2 GHz', '12 GB', '1500 GB', '17.3', , 35, 'Laptop'),
(17, 'Dell', '15z XPS15z-72ELS', 'The thinnest 15-inch PC on the planet, the Dell XPS 15z (model XPS15z-72ELS) delivers the power you need while keeping things light (just 5-1/2 pounds) and easily portable. Housed in a luxurious, eye-catching, and elegantly crafted case that''s less than an inch thick, it features a backlit keyboard with adjustable brightness. Rounded contours and precision-crafted lines give XPS 15z the illusion of floating just above every surface. It also offers a smooth-textured, comfort-designed palmrest and touchpad.  It''s powered by a second-generation Intel Core i5 dual-core processor ("Sandy Bridge"), which provides breakthrough digital media management, content creation, and 3D gaming capabilities. And you''ll enjoy a rich set of new features for a stunning and seamless visual PC experience with no additional hardware. It''s complemented by NVIDIA GeForce GT 525M graphics with 1 GB of dedicated DDR3 video memory and NVIDIA Optimus technology.  This Dell laptop features two speedy USB 3.0 ports--the latest development in USB data transfer technology. Perfect for transferring and retrieving large files between your PC and an external hard drive or digital camera, USB 3.0 offers the speediest, most efficient way get what you need from external devices. (It also comes with a combo eSATA/USB 2.0 port, plus the two USB 3.0 ports are backward compatible.)', 1200.99, '2.30 GHz', '6 GB', '500 GB', '15.6"', , 500, 'Laptop'),
(18, 'Apple', 'iPad 1', 'The original.', 199.00, '1 GHz', '1 GB', '16 GB', '10"', , 2, 'Tablet');
